description:
Approved Parcel Map Polygons is a polygon layer belonging to Vicmap Property Simplified 2, a modified and simplified model of Vicmap Property, specifically generated for Local Government use.. It consists of polygons representing Victoria's land parcels.
This layer should be used in conjuction with the other layers and aspatial tables that make up Vicmap Property Simplified 2,  see metadata for Vicmap Property and Vicmap Property Simplified 2.

Vicmap Property Simplified 2 Content includes
      · Parcel and Property Polygons;
      · Parcel and Property Identifiers - parcel descriptors (including Standard Parcel Identifiers (SPI)), 
        Council reference numbers;
      · Registered and proposed;
      · Crown and Freehold land differentiation;
      · Cadastral Road Casements;
      · Easements (Note: all new easements are being captured for the whole State. Previously, only 
        easements in the metropolitan area were captured. There is no current program to review and 
        capture missing easements);
      · Unique Feature Identifiers, date stamps and data quality information.

